    const sweetAlert = () => {
        console.log("Clicked");
        swal('Any fool can use a computer');
    }
    return (
        <div>
            <button onClick={sweetAlert}>My sweet alert button</button>
        </div>
    )
}

Alert.propTypes = {

}

